import React, {Component} from "react"
import "./Team.css"
import {translate} from "react-switch-lang";
import {Container, Row, Col, Image, Card} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';

class Team extends Component {
    state = {
        id:"0"
    }
    render() {
        const {t} = this.props;
        return (
            <Container fluid={true} className={"team"} id={this.props.id}>
                <div className={"pt-3"}>
                    <h1 className="text-center">{t('header.section5.title')}</h1>
                </div>
                    <Row className="p-3 row_white">
                        <Col sm={4}>
                            <Card>
                                <Card.Img src="Zespol-ja-1.jpg" width="1024" height="1024" className="img-fluid"  alt="Zespol ja"/>
                                <Card.Header className="text-center">Bernadetta Burkiewicz-Śliwa</Card.Header>
                                <Card.Body>
                                    <Card.Text className="text-center">

                                        adwokat - właściciel kancelarii
                                    </Card.Text>
                                </Card.Body>
                            </Card>

                        </Col>
                        <Col sm={8}>
                            <p className="text-justify">
                                Ukończyła studia prawnicze na Wydziale Prawa Uniwersytetu Jagiellońskiego w Krakowie w trybie stacjonarnym. W 2013 roku ukończyła aplikację adwokacką przy Okręgowej Radzie Adwokackiej w Krakowie a następnie zdała egzamin adwokacki. Praktykę zawodową wykonuje od 2008 roku, początkowo jako prawnik, a następnie jako aplikant adwokacki w krakowskiej kancelarii. Od 2013 roku prowadzi własną kancelarię. Posiada rozległe doświadczenie w obsłudze prawnej przedsiębiorców budowlanych, co stanowi jej wiodącą specjalizację. Uczestniczka konferencji krajowych i międzynarodowych z zakresu prawa medycznego jak również autorka publikacji z tego zakresu. Ponadto zajmuje się prawem karnym i rodzinnym. Prowadziła medialne procesy sądowe. Włada językiem angielskim.
                            </p>

                        </Col>
                    </Row>

            </Container>
        )
    }
}
export default translate(Team)
